import React from 'react'
import Devscreen from '../assets/devscreen.png';

const Potraitdev = () => {
  return (
    <div className='flex w-[60%] mx-auto'>
    <img className='w-[30%] mx-auto my-3 transform   hover:bg-z-600 transition duration-500 hover:scale-105' src={Devscreen} alt='/'/>
   </div>
  )
}

export default Potraitdev
